syntax = "proto3";



import "ForgeQueueData.proto";

message ForgeQueueDataNotify {
	enum EBMKPJICDKP {
		option allow_alias = true;
		NONE = 0;
		PEPPOHPHJOJ = 643;
		DCDNILFDFLB = 0;
		NNBKOLMPOEA = 1;
		EAJIABGAOCI = 1;
